import React from "react";
import Common from "./Common";
import web from "../src/Images/s1.jpg";

const Contact=()=>{
    return(
  <>
   <Common name="Welcome to Contact Page"
  imgsrc={web}
   visit='/contact' 
  btnname="Get Started"/>

 
  </>
    );

};
export default Contact;
